import React from "react";

const Product = (props) => {
    const [shoes] = props;

    return (
        <Col md={4}>
          <img src={shoes[0].imgUrl} width='80%' alt="shoes1" />
          <h4>{shoes[0].title}</h4>
          <p>{shoes[0].content}</p>
          <p>{shoes[0].price}</p>
          </Col>    
    )
}
export default Product
